    _cpu->PC += 2;
    push(_cpu, _cpu->PC >> 8);
    push(_cpu, _cpu->PC & 0xf);
    setFlags(_cpu, FLAG_B);
    push(_cpu, _cpu->flags);
    setFlags(_cpu, FLAG_I);
    _cpu->PC = read_mos6502(_cpu, IRQ_VEC);
    _cpu->PC |= read_mos6502(_cpu, IRQ_VEC + 1) << 8;
    return 7;
//exit(1);
