#define makeASL(addMode, clockcycles) int ASL_##addMode (mos6502 *_cpu) {\
    uint16_t address = addMode(_cpu);\
    uint16_t v = read_mos6502(_cpu, address) << 1;\
    write_mos6502(_cpu, address, (uint8_t) v);\
    donzc(_cpu, v);\
    return clockcycles;\
