#define makeROL(addMode, clockcycles) int ROL_##addMode (mos6502 *_cpu) {\
    uint16_t address = addMode(_cpu);\
    uint8_t v = read_mos6502(_cpu, address);\
    v = (v << 1) | (v >> 7);\
    write_mos6502(_cpu, address, v);\
    donz(_cpu, v);\
    setFlag(_cpu, FLAG_C, v & 1);\
