#define makeSBC(addMode, clockcycles) int SBC_##addMode(mos6502 *_cpu) {\
    uint8_t v = ~read_mos6502(_cpu, addMode(_cpu));\
    uint16_t val = _cpu->A - v - (testFlag(_cpu, FLAG_C) ? 1 : 0);\
    _cpu->A = (uint8_t) val;\
    donzc(_cpu, val);\
    setFlag(_cpu, FLAG_V, (v ^ _cpu->A) & 0x80);\
    return clockcycles;\
}
