int PLA(mos6502 *_cpu) {
    _cpu->A = pop(_cpu);
    donz(_cpu, _cpu->A);
    return 4;
}

int PHA(mos6502 *_cpu) {
    push(_cpu, _cpu->A);
    return 3;
}

int PLP(mos6502 *_cpu) {
    _cpu->flags = pop(_cpu);
    return 4;
}

int PHP(mos6502 *_cpu) {
    push(_cpu, _cpu->flags);
    return 3;
}

int RTI(mos6502 *_cpu) {
    _cpu->flags = pop(_cpu);
    _cpu->PC = (pop(_cpu) << 8) | pop(_cpu);
    return 6;
}

int RTS(mos6502 *_cpu) {
    _cpu->PC = (pop(_cpu) << 8) + pop(_cpu)+1;
    return 6;
}

